"use client";

import { useEffect, useState } from "react";
import { Card, CardContent, CardHeader, CardTitle } from "@/components/ui/card";
import { Bar, BarChart, ResponsiveContainer, XAxis, YAxis, Tooltip } from "recharts";
import { format } from "date-fns";
import TicketsDailyChart from "@/components/TicketsDailyChart"; // <-- Import nou
import { Separator } from "@/components/ui/separator";

export default function DashboardPage() {
  const [stats, setStats] = useState({ total: 0, closed: 0, avgTime: 0 });
  const [tickets, setTickets] = useState([]);
  const [statusChart, setStatusChart] = useState([]);
  const [teamChart, setTeamChart] = useState([]);
  const [dailyChart, setDailyChart] = useState([]); // <-- Nou
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch("/api/dashboard")
      .then((res) => res.json())
      .then((data) => {
        setStats(data.stats || { total: 0, closed: 0, avgTime: 0 });
        setTickets(data.tickets || []);
        setStatusChart(data.statusChart || []);
        setTeamChart(data.teamChart || []);
        setDailyChart(data.dailyChart || []); // <-- Setăm noile date
      })
      .finally(() => setLoading(false));
  }, []);

  return (
    <div className="p-6 space-y-6">
      <h1 className="text-3xl font-bold mb-6 text-gray-800 dark:text-white text-center">Dashboard</h1>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <Card className="hover:scale-105 transition-transform">
          <CardHeader>
            <CardTitle className="text-center">Tickete totale</CardTitle>
          </CardHeader>
          <CardContent>
            <p className="text-4xl font-bold text-center">{stats.total}</p>
          </CardContent>
        </Card>

        <Card className="hover:scale-105 transition-transform">
          <CardHeader>
            <CardTitle className="text-center">Tickete închise</CardTitle>
          </CardHeader>
          <CardContent>
            <p className="text-4xl font-bold text-center">{stats.closed}</p>
          </CardContent>
        </Card>

        <Card className="hover:scale-105 transition-transform">
          <CardHeader>
            <CardTitle className="text-center">Timp mediu de răspuns</CardTitle>
          </CardHeader>
          <CardContent>
            <p className="text-4xl font-bold text-center">{stats.avgTime} ore</p>
          </CardContent>
        </Card>
      </div>

      <Separator className="my-8" />

      {/* Grafic Status Tickets */}
      <div className="bg-white dark:bg-gray-800 p-6 rounded-lg shadow hover:scale-105 transition-transform">
        <h2 className="text-lg font-semibold mb-6 text-gray-700 dark:text-gray-300 text-center">
          Status Tickete
        </h2>
        {loading ? (
          <p className="text-center text-gray-400">Se încarcă...</p>
        ) : (
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={statusChart}>
              <XAxis dataKey="status" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="count" fill="#60a5fa" />
            </BarChart>
          </ResponsiveContainer>
        )}
      </div>

      {/* Grafic Time per Team */}
      <div className="bg-white dark:bg-gray-800 p-6 rounded-lg shadow hover:scale-105 transition-transform">
        <h2 className="text-lg font-semibold mb-6 text-gray-700 dark:text-gray-300 text-center">
          Timp mediu pe echipă
        </h2>
        {loading ? (
          <p className="text-center text-gray-400">Se încarcă...</p>
        ) : (
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={teamChart}>
              <XAxis dataKey="team" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="avgTime" fill="#34d399" />
            </BarChart>
          </ResponsiveContainer>
        )}
      </div>

      {/* Grafic nou Daily Chart */}
      <div className="bg-white dark:bg-gray-800 p-6 rounded-lg shadow hover:scale-105 transition-transform mb-12">
        <h2 className="text-lg font-semibold mb-6 text-gray-700 dark:text-gray-300 text-center">
          Evoluția Tickete
        </h2>
        {loading ? (
          <p className="text-center text-gray-400">Se încarcă...</p>
        ) : (
          <TicketsDailyChart data={dailyChart} />
        )}
      </div>
    </div>
  );
}
